function Square({}) {
  return <button className="square">1</button>;
}

export default function Board() {
  return (
    //  we use fragments (<> and </>) to wrap multiple adjacent JSX elements like this:
    <>
      <div className="board">
        <div className="board-row">
          <Square />
          <Square />
          <Square />
        </div>
        <div className="board-row">
          <Square />
          <Square />
          <Square />
        </div>
        <div className="board-row">
          <Square />
          <Square />
          <Square />
        </div>
      </div>
    </>
  );
}
